import React from 'react';
import {withRouter} from 'react-router-dom';
import { Context } from '../../App';
import Contactitem from '../contact-item-component/contact-item';

export default () => {
    return(
        <Context.Consumer>
            {
                <div>
                    {(obj) => {
                        obj.contacts.map((contact, index) => <Contactitem key={index} name={contact.name} id={contact.id} phone={contact}/>)
                    }}
                </div>
            }
        </Context.Consumer>
    );
}
